const BodyContent = () => (
  <div>
    <ul>
      body content
      <li>Read</li>
      <li>Top Stories</li>
    </ul>
  </div>
);

export const Body = () => (
  <div>
    <BodyContent />
  </div>
);

const Card = (props) => {
  return (
    <div className="card-container black">
      <div>{props.children}</div>
    </div>
  );
};

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Card>Helloe</Card>
      </header>
    </div>
  );
}
